public class Grad {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//increment the grade
	char grade='J';
	char grade1='k';
	grade=(char)(grade+10);
	System.out.println(grade);
	//Decrement the grade
	grade1=(char)(grade1-10);
	System.out.println(grade1);
	

	}

}
